import React from 'react';
import PropTypes from 'prop-types';

import Header from './Header';

const MainPage = ({ loginType }) => {
    return (
        <>
            <Header headerType={2} />
            <div>Main Page</div>
        </>
    );
};

MainPage.propTypes = {
    loginType: PropTypes.string.isRequired,
};

export default MainPage;
